import React from 'react';

export class Navbar extends React.Component {

    handleHome() {
        console.log("Returning home ...");
    }

    render() {
        return(
            <>
                <div className="fixed bottom-0 left-0">
                    <div className=' bg-violet-600 rounded-tl-full rounded-tr-full h-4 w-54 shadow-md'>

                    </div>
                    <button onClick={this.handleHome} className='pb-4 justify-center items-center flex bg-violet-600 w-screen h-20'>

                        <div className='rounded-full bg-white w-12 h-12 justify-center items-center flex'>
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="purple" className="w-6 h-6">
                                <path d="M11.47 3.84a.75.75 0 011.06 0l8.69 8.69a.75.75 0 101.6-1.06l-8.689-8.69a2.25 2.25 0 00-3.182 0l-8.69 8.69a.75.75 0 001.061 1.06l8.69-8.69z" />
                                <path d="M12 5.432l8.159 8.159c.03.03.06.058.091.086v6.198c0 1.035-.84 1.875-1.875 1.875H15a.75.75 0 01-.75-.75v-4.5a.75.75 0 00-.75-.75h-3a.75.75 0 00-.75.75V21a.75.75 0 01-.75.75H5.625a1.875 1.875 0 01-1.875-1.875v-6.198a2.29 2.29 0 00.091-.086L12 5.43z" />
                            </svg>
                        </div>

                    </button>
                </div>
            </>
        );
    }
}
